--
-- Name: associate_np_w_up(integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION associate_np_w_up(_create_event_id integer) RETURNS void
    LANGUAGE plpgsql
    AS $$
BEGIN

  -- associate the neighborhood_polygons with the user polygons
  SELECT 
    np.id as neighborhood_polygon_id, 
    user_polygon.id as up_id 
  FROM neighborhood_point_strength_of_identity npsoi
  JOIN test_point 
    ON test_point.id = npsoi.test_point_id
  JOIN trans_ce_tp_up 
    ON trans_ce_tp_up.test_point_id = test_point.id AND trans_ce_tp_up.create_event_id = _create_event_id
  JOIN user_polygon 
    ON user_polygon.id = trans_ce_tp_up.user_polygon_id
  JOIN neighborhood 
    ON neighborhood.id = npsoi.neighborhood_id
  JOIN neighborhood_polygon np
    ON np.neighborhood_id = neighborhood.id AND np.create_event_id = _create_event_id
  WHERE 
    npsoi.create_event_id = _create_event_id
  GROUP BY np.id, user_polygon.id
);
END;
$$;


--
-- Name: associate_test_points_w_user_polygons(integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION associate_test_points_w_user_polygons(test_point_set_num integer) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
  _r record;
BEGIN

  -- delete anything in with the current set number
  DELETE FROM trans_tp_up USING test_point
    WHERE test_point.id = trans_tp_up.test_point_id 
    AND test_point.set_num = test_point_set_num;

  FOR _r IN EXECUTE 'SELECT test_point.id as test_point_id, user_polygon.id as up_id'
			||' FROM user_polygon'
			||' INNER JOIN test_point ON ST_Contains(polygon,test_point.point) = true'
			||' WHERE test_point.set_num = '||test_point_set_num
  LOOP
  END LOOP;

  RETURN;
END;
$$;


--
-- Name: contentious_points(integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION contentious_points(_create_event_id integer) RETURNS void
    LANGUAGE plpgsql
    AS $$
BEGIN
    SELECT DISTINCT     
      _create_event_id,
      test_point.id,
      test_point.point,
      a.strength_of_identity
    FROM 
      neighborhood_point_strength_of_identity a, 
      neighborhood_point_strength_of_identity b,
      test_point
    
    WHERE
      test_point.id = a.test_point_id
      AND  a.id <> b.id
      AND a.test_point_id = b.test_point_id
      AND a.strength_of_identity = b.strength_of_identity
      AND a.create_event_id = _create_event_id
      AND a.create_event_id = b.create_event_id
    GROUP BY test_point.id,a.strength_of_identity,test_point.point
  );
END;
$$;


