--
-- Name: create_neighborhood_polygons(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION create_neighborhood_polygons() RETURNS SETOF geometry
    LANGUAGE plpgsql
    AS $$
DECLARE
  _r record;
  _sum_of_polygons_per_point integer;
  polygon geometry;
BEGIN
  
  FOR _r IN EXECUTE 'SELECT * FROM neighborhood' LOOP

    SELECT ST_SetSRID( ST_ConcaveHull( ST_Collect( point ),.99 ),4326) INTO polygon
    FROM my_temp_table 
      WHERE 
        neighborhood_id = _r.id 
        AND strength_of_identity > .5;

    RETURN NEXT polygon;
  END LOOP;
END;
$$;


--
-- Name: create_neighborhood_polygons(integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION create_neighborhood_polygons(test_point_set_num integer) RETURNS SETOF geometry
    LANGUAGE plpgsql
    AS $$
DECLARE
  _r record;
  _sum_of_polygons_per_point integer;
  polygon geometry;
BEGIN
  
  FOR _r IN EXECUTE 'SELECT * FROM neighborhood' LOOP

    SELECT ST_SetSRID( ST_ConcaveHull( ST_Collect( heat_map_test_point.point ),.99 ),4326) INTO polygon
    FROM my_temp_table
    INNER JOIN heat_map_test_point ON my_temp_table.test_point_id = heat_map_test_point.id
      WHERE 
        heat_map_test_point.set_num = test_point_set_num
        AND neighborhood_id = _r.id 
        AND strength_of_identity > .5;

    RETURN NEXT polygon;
  END LOOP;
END;
$$;


--
-- Name: create_strength_of_identity(integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION create_strength_of_identity(_create_event_id integer) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
  _r record;
  _sum_of_polygons_per_point integer;
  _test_point_meter_width integer;
  _npsoi_id integer;
BEGIN

  -- delete anything in with the current set number
  DELETE FROM neighborhood_point_strength_of_identity WHERE create_event_id = _create_event_id;

  SELECT test_point_meter_width INTO _test_point_meter_width FROM create_neighborhood_polygons_event WHERE id = _create_event_id;
  
  FOR _r IN EXECUTE 'SELECT test_point.id as test_point_id, neighborhood_id'
			||' FROM user_polygon'
			||' INNER JOIN neighborhood ON user_polygon.neighborhood_id = neighborhood.id'
			||' INNER JOIN test_point ON ST_Contains(polygon,test_point.point) = true'
			||' WHERE test_point.set_num = '||_test_point_meter_width
  LOOP

    -- if the text point ID already exists in table, increment 
    IF EXISTS ( SELECT 1 FROM neighborhood_point_strength_of_identity WHERE test_point_id = _r.test_point_id AND neighborhood_id = _r.neighborhood_id ) THEN
      UPDATE neighborhood_point_strength_of_identity SET num_polygons_for_name = num_polygons_for_name + 1 
        WHERE 
	  test_point_id = _r.test_point_id 
	  AND neighborhood_id = _r.neighborhood_id
	  AND create_event_id = _create_event_id
	RETURNING id INTO _npsoi_id;
    ELSE
	VALUES( _create_event_id, _r.test_point_id, _r.neighborhood_id, 1,0) RETURNING id INTO _npsoi_id;
    END IF;

    -- get a count of how many user polygons total there are for the test point, and update the table
    SELECT SUM(num_polygons_for_name) INTO _sum_of_polygons_per_point FROM neighborhood_point_strength_of_identity WHERE test_point_id = _r.test_point_id AND create_event_id = _create_event_id;

    IF _sum_of_polygons_per_point IS NULL THEN
      RAISE EXCEPTION '_sum_of_polygons_per_point should not be null';
    END IF;
    
    UPDATE neighborhood_point_strength_of_identity SET 
      num_polygons_for_point = _sum_of_polygons_per_point,
      strength_of_identity = num_polygons_for_name::float / _sum_of_polygons_per_point 
    WHERE 
      test_point_id = _r.test_point_id 
      AND create_event_id = _create_event_id;
	
  END LOOP;

END;
$$;


--
-- Name: delete_user_polygon(integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION delete_user_polygon(_up_id integer) RETURNS void
    LANGUAGE plpgsql
    AS $$
BEGIN

  IF ( SELECT 1 FROM user_polygon WHERE id = _up_id LIMIT 1 ) THEN
    DELETE FROM trans_tp_up WHERE user_polygon_id = _up_id;
    DELETE FROM trans_np_up WHERE up_id = _up_id;
    DELETE FROM user_polygon WHERE id = _up_id;

    RAISE NOTICE 'you must re-run the process to build neighborhood_polygons';
  ELSE
    RAISE EXCEPTION 'user_polygon with id % does not exist',test_up_id;
  END IF;

END;
$$;


--
-- Name: init_stuff(integer, double precision); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION init_stuff(set_number integer, concave_hull_target_precision double precision) RETURNS void
    LANGUAGE plpgsql
    AS $$
BEGIN

  PERFORM associate_test_points_w_user_polygons( set_number );
  PERFORM create_strength_of_identity( set_number );
  PERFORM create_neighborhood_polygons( set_number, concave_hull_target_precision );
  PERFORM associate_np_w_up( set_number );
END;
$$;


